import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer bg-light text-center py-3 mt-5">
      <div className="container">
        <p className="mb-1">&copy; {new Date().getFullYear()} Maria Elheeb & Yazan Dawud</p>
        <div className="footer-links">
          <a href="https://github.com/maria" target="_blank" rel="noopener noreferrer">Maria GitHub</a>
          <span className="mx-2">|</span>
          <a href="https://github.com/yazandahood8" target="_blank" rel="noopener noreferrer">Yazan GitHub</a>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
